In Buddhism, the Four Noble Truths are "the truths of the noble one ," a statement of how things really are when they are seen correctly. The four truths aredukkha. Dukkha is an innate characteristic of transient existence; nothing is forever, this is painful;
samudaya : together with this transient world and its pain, there is also thirst, craving for and attachment to this transient, unsatisfactory existence;
nirodha : the attachment to this transient world and its pain can be severed or contained by the confinement or letting go of this craving;
marga : the Noble Eightfold Path is the path leading to the confinement of this desire and attachment, and the release from dukkha.
The Three Treasures or Three Jewels are basic virtues in Taoism. Although the Tao Te Ching originally used sanbao to mean "compassion", "frugality", and "humility", the term was later used to translate the Three Jewels in Chinese Buddhism, and to mean the Three Treasures in Traditional Chinese Medicine.

